import React from "react";
import Card from "@mui/material/Card";
import CardContent from "@mui/material/CardContent";
import Typography from "@mui/material/Typography";
import ChartImage from "../assets/chart.png";

export default function Intrestpage({ progressBarWidth }) {
  const CardContents = [
    {
      image: ChartImage,
      description: "Student or soon to be enrolled",
    },
    {
      image: ChartImage,
      description: "Professional pursuing a career",
    },
    {
      image: ChartImage,
      description: "Parent of a school-age-child",
    },
    {
      image: ChartImage,
      description: "Lifelong learner",
    },
    {
      image: ChartImage,
      description: "Teacher",
    },
    {
      image: ChartImage,
      description: "Other",
    },
  ];

  return (
    <div
      style={{
        display: "flex",
        flexDirection: "column",
        alignItems: "center",
        width: "80%", // Set width to 80%
        margin: "auto", // Center the container
      }}
    >
      <div style={{ width: "100%" }}>
        <p
          style={{
            fontFamily: "Roboto",
            fontSize: 22,
            fontWeight: "bold",
            textAlign: "center",
          }}
        >
          Which describes you best?
        </p>
        <p
          style={{
            fontFamily: "Roboto",
            textAlign: "center",
            marginBottom: "20px",
          }}
        >
          This will help us personalize your experience.
        </p>
      </div>
      <div>
        {CardContents.map((content, index) => (
          <Card
            key={index}
            variant="outlined"
            style={{
              height: "70px",
              width: "100%", // Make each card take full width initially
              marginBottom: 10,
              marginLeft: 20, // Add some margin between cards
              marginRight: 20,
            }}
          >
            <CardContent style={{ display: "flex", alignItems: "center" }}>
              <img
                src={content.image}
                alt="Chart"
                style={{ marginRight: "10px", width: "50px", height: "35px" }}
              />
              <div>
                <Typography component="div">{content.description}</Typography>
              </div>
            </CardContent>
          </Card>
        ))}
      </div>
    </div>
  );
}
